import SearchBar from "../Components/SearchBar";
import Swan from "../Components/Swan";
import SwanResult from "../Components/SwanResult";
import "../styles/Main.scss";
import React, { useEffect } from "react";

function Main() {
  return (
    <div className="App">
      <div class="bar">
        <p class="putoshka">Putoshka: Swan Scanner</p>
      </div>
      <div class="main">
        <div class="left">
          <p>Обработанные фото</p>
          <SearchBar/>
          <div class="swanDataset">
            <Swan/>
          </div>
        </div>
        <div classname="right">
          <SwanResult/>
          <button class="addSwans">Добавить фотографии</button>
        </div>
      </div>
    </div>
  );
}

export default Main;
